DROP TABLE IF EXISTS `posts`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `posts` (
  `profile_id` bigint unsigned NOT NULL COMMENT 'Ссылка на пользователя, который создал пост',
  `description` text COMMENT 'Бла-бла',
  `created_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT 'Время обновления строки',
  `GUID` varchar(255) NOT NULL COMMENT 'GUID to Identify post GENERATED ON CLIENT',
  PRIMARY KEY (`profile_id`,`created_at`) COMMENT 'составной ключ с ограничением 1 пост одновременно с 1го профиля',
  UNIQUE KEY `GUID` (`GUID`),
  CONSTRAINT `posts_profile_id_profiles` FOREIGN KEY (`profile_id`) REFERENCES `profiles` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='пост';
