DROP TABLE IF EXISTS `relationships`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `relationships` (
  `from_profile_id` bigint unsigned NOT NULL COMMENT 'Ссылка на инициатора дружеских отношений',
  `to_profile_id` bigint unsigned DEFAULT NULL COMMENT 'Ссылка на получателя приглашения дружить',
  `status_id` tinyint unsigned DEFAULT NULL COMMENT 'Ссылка на статус (текущее состояние) отношений',
  `confirmed_at` datetime DEFAULT CURRENT_TIMESTAMP COMMENT 'Время подтверждения приглашения',
  `created_at` datetime DEFAULT CURRENT_TIMESTAMP COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT 'Время обновления строки',
  UNIQUE KEY `from_to_status` (`from_profile_id`,`to_profile_id`,`status_id`),
  KEY `status_id_statuses` (`status_id`),
  KEY `relationships_to_profile_id_users` (`to_profile_id`),
  CONSTRAINT `relationships_from_profile_id_users` FOREIGN KEY (`from_profile_id`) REFERENCES `users` (`profile_id`) ON DELETE CASCADE,
  CONSTRAINT `relationships_to_profile_id_users` FOREIGN KEY (`to_profile_id`) REFERENCES `users` (`profile_id`) ON DELETE CASCADE,
  CONSTRAINT `status_id_statuses` FOREIGN KEY (`status_id`) REFERENCES `statuses` (`id`) ON DELETE SET NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='All users relations';
/*!40101 SET character_set_client = @saved_cs_client */;

